  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Missisquoi
  National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year. The report begins by summarizing the habitat conditions, water conditions,
  and food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, mammals, raptors, fish,
  and diseases- is also covered. The Refuge development and maintenance section discusses
  physical developments and vegetation control. Resource management is outlined; topics
  include grazing and haying. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, hunting, and safety. Items of interest are included.\",\n\t\"owner_org\":
